function Movie(id, title_long, medium_cover_image, genres, summary) {
  return (
    <div key={id}>
      <h2>{title_long}</h2>
      <img alt="medium_cover_image" src={medium_cover_image}></img>
      <ul>
        {genres.map((genre) => (
          <li key={genre}>{genre}&nbsp;</li>
        ))}
      </ul>
      <p>{summary}</p>
    </div>
  );
}
export default Movie;
